        <img src={logo} className="App-logo" alt="logo" /> 
        <h1 className="App-title">Weaver here. Your local weather beaver.</h1>

        <br />
        <p>
        <br />
          Search for an area below to receive its weather information.

        </p>

        <Search onWeatherData={handleWeatherData} />
        {weatherData && <WeatherDisplay weatherData={weatherData} />} 
      </header>
      <footer className="App-footer">
        {/* Add your GitHub and LinkedIn links here */}
        <div>
  <a href="https://github.com/xStFtx" target="_blank">GitHub</a>
  <a href="https://www.linkedin.com/in/philip-esterhuizen-39552b21b/" target="_blank">LinkedIn</a>
</div>

      </footer>
    </div>
  );
}

export default App;
